function init(){var e=performance.timing;var t=(new Date).getTime();var n="mattshull.com"+location.pathname;var r=((e.responseEnd-e.requestStart)/1e3).toFixed(2);var i=((t-e.domLoading)/1e3).toFixed(2);var s=((t-e.navigationStart)/1e3).toFixed(2);document.getElementById("webperf-clientBackend").innerHTML=r;document.getElementById("webperf-clientFrontend").innerHTML=i;document.getElementById("webperf-clientTotal").innerHTML=s;if(s>totalBudget){document.getElementById("webperf-clientTotal").className="webperf-red"}else{document.getElementById("webperf-clientTotal").className="webperf-green"}var o={backend:r,frontend:i,total:s,url:n};var u=new XMLHttpRequest;u.onreadystatechange=function(){if(u.readyState==4&&u.status==200){var e=JSON.parse(u.responseText);document.getElementById("webperf-serverBackend").innerHTML=e.backend;document.getElementById("webperf-serverFrontend").innerHTML=e.frontend;document.getElementById("webperf-serverTotal").innerHTML=e.total;if(e.total>totalBudget){document.getElementById("webperf-serverTotal").className="webperf-red"}else{document.getElementById("webperf-serverTotal").className="webperf-green"}}};u.open("POST","./webperfSubmit.php",true);u.send(JSON.stringify(o))}window.onload=init
